class Signup extends Component{

    constructor(){
        super();
        this.state={
            name:"",
            email:"",
            password:"",
            error:""
        }
    }
    render(){
        return(
            <div>
                <h2> Signup</h2>
            </div>
        )
    }
}

export default Signup;

